import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Main from "./main/Main";
import Join from "./join/Join";

function App() {
  return (
    <>
      <Router>
          <Routes>
            <Route path="/" exact={true} element={<Main />} />
            <Route path="/join" element={<Join />} />
          </Routes>
      </Router>
    </>
  );
}

export default App;
